var express = require("express");
var app = express.Router();

app.use(function(req, res, next) {
  res.header("Access-Control-Allow-Origin", "*");
  res.header("Access-Control-Allow-Headers", "Origin, X-Requested-With, Content-Type, Accept");
  next();
});

app.get("/poi", function (req, res, next) {
      var results = [];
      getOpenData().features.forEach(function(curr) {
        if (curr.properties.trade_description.toLowerCase().includes("restaurant") && curr.geometry !== null) {
          results.push({
            name: curr.properties.TRADE_NAME,
            addr : curr.properties.CIVIC_ADDRESS,
            latlng : [curr.geometry.coordinates[1],curr.geometry.coordinates[0]]
          });
        }
      });
      res.send(results);
    });

